import React from "react";

function getCharacters({ characters, loading }: any) {
  if (loading) {
    return <h2>Loading...</h2>;
  }

  return (
    <ul>
      {characters.map((character: any) => (
        <li key={character.id}>{character.name}</li>
      ))}
    </ul>
  );
}

export default getCharacters;
